import React,{Component} from 'react';


// este emucho mejor!!!
 var search = require('youtube-search');
 var opts = {
     maxResults: 10,
     key: 'AIzaSyAHoZvRooqSclkRZAvtOwGMg4FhISRDrCc'
   };
   search('The Rolling stones', opts, function(err, results) {
    if(err) return console.log(err);
    console.dir(results);
  });


class TodoForma1 extends Component{
    constructor(props){
       super(props);
       const dato=this.props.cosas.match.params
       //console.log(props)
       //console.log(dato)
        this.state={
            prioridad1: props.valor1,
            prioridad2: dato.id
        }


        //let messages = await Chat.find({}).limit(8).sort('-created');           
    };  

    render(){
         return(
            <div className="col-md-2">
              <h1>soy compo1 valor={this.state.prioridad1}</h1>
              <h1>dato URL={this.state.prioridad2}</h1>
              
            </div>            
        )
    }

}
export default TodoForma1;
